ALPHABET = "abcdefghijklmnopqrstuvwxyz"

class UnionFind:
    def __init__(self, words):
        self.parent = dict()
        for w in words:
            self.parent[w] = w

    def poke(self, w):
        if w not in self.parent:
            self.parent[w] = w

    def find(self, a):
        acopy = a
        while a != self.parent[a]:
            a = self.parent[a]
        while acopy != a:
            self.parent[acopy], acopy = a, self.parent[acopy]
        return a

    def join(self, a, b):
        self.parent[self.find(b)] = self.find(a)

def score(w):
    ret = 0
    for c in w:
        ret |= (1 << (ord(c) - ord('a')))
    return ret

class Solution:
    def groupStrings(self, words):
        l_words = [score(w) for w in words]
        words = set(l_words)

        uf = UnionFind(words)

        for w in words:
            for c in ALPHABET:
                new_w = w & ~score(c)

                uf.poke(new_w)
                uf.join(w, new_w)

        P = defaultdict(int)
        for w in l_words:
            P[uf.find(w)] += 1

        return len(P), max(P.values())



